import PieChart from './components/Piechart';
import {options,data,Bar} from './components/BarChart'

function App() {
  return (
    <div className="App">
      <Navbar/>

      <Example/>
      <div  className='denish'>
      <PieChart />
      </div>



    </div>
  );
}

export default App;
